import React from "react";
import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Sidebar from "./Components/Sidebar";
import Home from "./pages/Home/Home";

const App = () => {
  return (
    <BrowserRouter>
      <Sidebar>
        <Routes>
          <Route path="/Home" element={<Home />} />
        </Routes>
      </Sidebar>
    </BrowserRouter>
  );
};

export default App;
